/* Convertion from 3 bytes info to uint32_t */
#define CONVERT(C) 	(((uint32_t)info.data.ch[C].Channel[0]) << 16) + (((uint32_t)info.data.ch[C].Channel[1]) << 8) + ((uint32_t)info.data.ch[C].Channel[2])

