/*******************************************************************************
* Function Name: allFFTReady
********************************************************************************
* Summary:
*  Verify if at least one element of an array is false
*
* Parameters:
*  boll arr[], int size
*
* Return:
*  void
*
*******************************************************************************/
bool allFFTReady(const bool arr[], int size) {
    for (int i = 0; i < size; i++) {
        if (!arr[i]) {
            return false;
        }
    }
    return true;
}
